import React from 'react';
import InfoCard from './InfoCard';
import { FaUsers, FaChalkboardTeacher, FaRoute, FaBuilding } from 'react-icons/fa';
import styles from './Dashboard.module.css';

const Dashboard = () => {
  const dummyData = [
    { title: 'Advisors', value: 34, icon: <FaUsers />, bgColor: '#6C63FF' },
    { title: 'Guides', value: 53, icon: <FaChalkboardTeacher />, bgColor: '#FF6584' },
    { title: 'Tours', value: 49, icon: <FaRoute />, bgColor: '#FFCC29' },
    { title: 'Fairs', value: 9, icon: <FaBuilding />, bgColor: '#3DBE29' },
  ];

  return (
    <div className={styles.dashboard}>
      <h1 className={styles.title}>Dashboard</h1>
      <div className={styles.infoCards}>
        {dummyData.map((data, index) => (
          <InfoCard
            key={index}
            title={data.title}
            value={data.value}
            icon={data.icon}
            bgColor={data.bgColor}
          />
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
